import React from 'react'

export default function TopButtons({setQuery}) {
    const cities=[
        {
            id:1,
            title:'London'
        },
        {
            id:2,
            title:'Sydney'
        },
        {
            id:3,
            title:'Tokyo'
        },
        {
            id:4,
            title:'Toronto'
        },
        {
            id:5,
            title:'Paris'
        }
    ]

  return (
    <div className='flex items-center justify-around my-6'>
        {cities.map((city)=>(
            <button key={city.id} className='text-white text-lg font-medium transition ease-out hover:scale-110' onClick={setQuery}>{city.title}</button>
        ))}
    </div>
  )
}
